INSERT INTO `admin_tutorial_list` (`id`, `page_title`, `title`, `uid`, `details`, `status`) VALUES (1, 'Settings,Order Configuration', 'How to configure email settings', '1692710150923', '<p>If you use the SMTP mail function make sure All credentials are correct.Gmail Host:  smtp.gmail.com\r\nGmail Port:  465<br>1. Login to your Gmail2. Go to Security setting and Enable 2 factor authentication3. After enabling this you can see app passwords option4. And then, from Your app passwords tab select Other option and put your app name and click GENERATE button to get new app password.5. Finally copy the 16 digit of password and click done. Now use this password instead of email password to send mail via your app.</p><p><br></p><p><br><iframe frameborder=\"0\" src=\"//www.youtube.com/embed/GNAkcfeZIII\" width=\"640\" height=\"360\" class=\"note-video-clip\"></iframe></p>', 1);
