INSERT INTO `expense_list` (`id`, `category_id`, `user_id`, `shop_id`, `title`, `created_at`, `amount`, `images`, `notes`) VALUES (2, 2, 8, 1, 'test', '2023-03-28', '568', 'uploads/site_images/17a2660f480b89db2c4816ebcca3129d.jpg', '    public function edit_services($id)    {        $data = array();        $data[\'page_title\'] = \"Services\";        $data[\'page\'] = \"Profile\";        $data[\'data\'] = $this->admin_m->single_select_by_id($id, \'services\');        $data[\'services\'] = $this->admin_m->select_all_by_user(\'services\');        valid_user($data[\'data\'][\'user_id\']);        $data[\'main_content\'] = $this->load->view(\'backend/users/services\', $data, true);        $this->load->view(\'backend/index\', $data);    }<br>    /**     *** add services     **/    public function add_services()    {        is_test();        $this->form_validation->set_rules(\'title\', \'Title\', \'trim|required|xss_clean\');        $this->form_validation->set_rules(\'details\', \'Details\', \'required|xss_clean\');        if ($this->form_validation->run() == false) {            $this->session->set_flashdata(\'error\', validation_errors());            $this->services();        } else {            $data = array(                \'title\' => $this->input->post(\'title\', true),                \'user_id\' => auth(\'id\'),                \'icon\' => $this->input->post(\'icon\', true),                \'details\' => $this->input->post(\'details\'),                \'created_at\' => d_time(),            );            $id = $this->input->post(\'id\');            if ($id == 0) {                $insert = $this->admin_m->insert($data, \'services\');            } else {                $insert = $this->admin_m->update($data, $id, \'services\');            }<br>            if ($insert) {                $this->session->set_flashdata(\'success\', !empty(lang(\'success_text\')) ? lang(\'success_text\') : \'Save Change Successful\');                redirect(base_url(\'admin/auth/services\'));            } else {                $this->session->set_flashdata(\'error\', !empty(lang(\'error_text\')) ? lang(\'error_text\') : \'Somethings Were Wrong!!\');                redirect(base_url(\'admin/auth/services\'));            }        }    }<br><br><br>    public function item_delete($id, $table)    {        is_test();<br><br>        $img = $this->admin_m->single_select_by_id($id, $table);<br>        if (isset($img[\'images\']) && !empty($img[\'images\'])) {            delete_image_from_server($img[\'images\']);        }        if (isset($img[\'thumb\']) && !empty($img[\'thumb\'])) {            delete_image_from_server($img[\'thumb\']);        }        $del = $this->admin_m->item_delete($id, $table);                if ($del) {<br>            $this->session->set_flashdata(\'success\', lang(\'success_text\'));            redirect($_SERVER[\'HTTP_REFERER\']);        } else {            $this->session->set_flashdata(\'error\', lang(\'success_text\'));            redirect($_SERVER[\'HTTP_REFERER\']);        }    }<br>');
