INSERT INTO `items` (`id`, `user_id`, `shop_id`, `cat_id`, `item_id`, `language`, `allergen_id`, `title`, `images`, `thumb`, `veg_type`, `price`, `is_size`, `details`, `overview`, `is_features`, `status`, `created_at`, `remaining`, `in_stock`, `img_type`, `img_url`, `extra_images`, `orders`, `tax_fee`, `tax_status`, `uid`, `is_pos_only`, `is_default`) VALUES (1, 8, 1, 1, 1, 'english', 'null', 'Italian Pizza', 'uploads/thumb/iPGQk3al1703518722.jpg', 'uploads/thumb/iPGQk3al1703518722-300_350.jpg', 2, '{\"variant_name\":\"Size\",\"variant_options\":[{\"name\":\"S\",\"price\":\"10\",\"slug\":\"slug_0\"},{\"name\":\"M\",\"price\":\"20\",\"slug\":\"slug_1\"},{\"name\":\"L\",\"price\":\"30\",\"slug\":\"slug_2\"}]}', 1, '<p>Pizza inglesina is a variety of traditional Italian pizza that is topped with tomato sauce, mozzarella, and <em style=\"box-sizing: inherit; color: rgb(41, 41, 41); font-family: muli; font-size: 18px;\">prosciutto crudo</em>. This last ingredient is a type of traditional Italian raw, dry-cured ham as opposed to <em style=\"box-sizing: inherit; color: rgb(41, 41, 41); font-family: muli; font-size: 18px;\">prosciutto cotto</em>, which is cooked ham, both of which are staples in Italian cuisine<br></p>', 'Pizza Inglesina is a variety of traditional Italian pizza that is topped with tomato sauce, mozzarella, and prosciutto crudo. This last ingredient is a type of traditional Italian raw, dry-cured ham as opposed to prosciutto cotto, which is cooked ham, both of which are staples in Italian cuisine', 1, 1, '2024-01-25 15:31:14', 0, 0, 1, '', NULL, 1, '0', '0', NULL, 0, 0);
