INSERT INTO `language_data` (`id`, `keyword`, `type`, `details`, `english`, `ar`, `es`, `ru`, `cn`, `fr`, `pt`, `hindi`) VALUES (284, 'limit_text_msg_2', 'admin', 'Select limit from drop down. if you not select any limit then it will set by default', 'Select limit from dropdown. if you do not select any limit then it will set by default', 'حدد حدًا من القائمة المنسدلة. إذا لم تحدد أي حد , فسيتم تعيينه افتراضيًا', 'Seleccione el límite del menú desplegable. Si no selecciona ningún límite, se establecerá de forma predeterminada', 'Выберите лимит из раскрывающегося списка. Если вы не выберете какой-либо лимит, он будет установлен по умолчанию', '从下拉列表中选择限制。如果你没有选择任何限制，那么它将默认设置', 'Sélectionnez la limite dans la liste déroulante. Si vous ne sélectionnez aucune limite, elle sera définie par défaut', 'Selecione o limite no menu suspenso. Se você não selecionar nenhum limite, ele será definido por padrão', 'ड्रॉपडाउन से सीमा चुनें। यदि आप कोई सीमा नहीं चुनते हैं तो यह डिफ़ॉल्ट रूप से सेट हो जाएगी');
