  `created_at` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: expense_category_list
#

DROP TABLE IF EXISTS `expense_category_list`;

