) ENGINE=InnoDB AUTO_INCREMENT=328 DEFAULT CHARSET=utf8mb4;



#
# TABLE STRUCTURE FOR: item_packages
#

DROP TABLE IF EXISTS `item_packages`;

CREATE TABLE `item_packages` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
